import React from 'react';
import LibroRow from './LibroRow';

type Libro = {
  id: number;
  titulo: string;
  imagen?: string;
  precio: number;
  disponible: boolean;
  editorial?: { nombre: string };
  genero?: { nombre: string };
};

type LibroTableProps = {
  libros: Libro[];
};

export default function LibroTable({ libros }: LibroTableProps) {
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>ID</th>
          <th>Título</th>
          <th>Imagen</th>
          <th>Precio</th>
          <th>Editorial</th>
          <th>Género</th>
          <th>Disponible</th>
        </tr>
      </thead>
      <tbody>
        {libros.length === 0 ? (
          <tr>
            <td colSpan={7} className="text-center">
              No se encontraron libros
            </td>
          </tr>
        ) : (
          libros.map((libro) => (
            <LibroRow key={libro.id} {...libro} />
          ))
        )}
      </tbody>
    </table>
  );
}
